import React, { Fragment } from "react";
import MainHOC from "../component/main.hoc";

const Index = () => {

  const hello = "Hello World!!!!"
  return (
    <MainHOC>
      <section class="section">
        <div class="container">
          <h1 class="title">
            Hello World
      </h1>
          <p class="subtitle">
            My first website with <strong>Bulma</strong>!
      </p>
        </div>
      </section>
    </MainHOC>
  );
};
export default Index;
